    //see above comment on how this works.
    var image = [Images["Probe"],Images["ATNS"]];
    var shaderProgram = shader["Text"];
    var buffers = undefined;
    var textures = undefined;


    Probes = function Probes (position, run, scale) {
        this.position = position || [0,3, 0];
        this.scale = scale || 1;
        this.run = run;
        this.go_return = "go";
        this.flag = true;
    }

    Probes.prototype.init = function () {

        if (!buffers) {
            var arrays = {
                pos: {numComponents: 3, data: v},
                norm: {numComponents: 3, data: vn},
                Texc: {numComponents: 2, data: vt},
                indices: ind
            };
            buffers = twgl.createBufferInfoFromArrays(gl, arrays);
        }
        if(!textures){
            textures = [];
            for(var i = 0;i < image.length;i++){
                var text = {};
                text["ts"] = gl.getUniformLocation(shaderProgram.program, "texSampler"+i);
                text["s"] = createGLTexture(gl, image[i],true);
                textures.push(text);
            }
        }

        this.orientation = 0;
        this.dir_o = 0;
        this.lastMin = undefined;
        this.state = 1;
        this.wait = getRandomInt(250,1000);
        this.lastTime = 0;
    }

    Probes.prototype.setflag = function (f) {
        this.flag = f;
    }

    Probes.prototype.draw = function () {
        if(this.run) advance(this);

        var trans = new Transform();
        if(this.flag) trans.trans(m4.translation(this.position),true);
        trans.trans(m4.rotationY(this.orientation));
        trans.trans(m4.scaling([this.scale, this.scale, this.scale]));

        gl.useProgram(shaderProgram.program);
        gl.disable(gl.CULL_FACE);
        twgl.setUniforms(shaderProgram, {
            tview: drawingState.view, tproj: drawingState.proj, dlight: drawingState.sunDirection,
            tmodel: trans.get_Trans() ,tnorm: trans.get_Tnorm(),lview: drawingState.lview, lproj: drawingState.lproj
            ,flag: this.flag?0.0:2.0
        });
        twgl.setBuffersAndAttributes(gl, shaderProgram, buffers);

        for(var i = 0;i < image.length;i++){
            gl.activeTexture(gl["TEXTURE"+i]);
            gl.bindTexture(gl.TEXTURE_2D, textures[i].s);
            gl.uniform1i(textures[i].ts, i);
        }

        twgl.drawBufferInfo(gl, gl.TRIANGLES, buffers);
    }

    var flyingSpeed = 3/1000;          // units per milli-second
    var turningSpeed = 2/1000;         // radians per milli-second

    var mid ={position:[0,0,0]};

    // find a random helipad - allow for excluding one (so we don't re-use last target)
    function randomMineral(exclude) {
        var minerals = [];
        for(var name in grobjects){
            var obj =  grobjects[name];
            if (obj.mineral && (obj!=exclude))  minerals.push(obj);
        }
        if (!minerals.length) {throw("No minerals for the Probes!");}
        var idx = getRandomInt(0,minerals.length);
        return minerals[idx];
    }

    // this actually does the work
    function advance(Probes) {
        if (!Probes.lastTime) {
            Probes.lastTime = drawingState.realtime;
            return;
        }
        var delta = drawingState.realtime - Probes.lastTime;
        Probes.lastTime = drawingState.realtime;

        // now do the right thing depending on state
        switch (Probes.state) {
            case 0: // on the ground, waiting for take off
                if (Probes.wait > 0) { Probes.wait -= delta; }
                else {  // take off!
                    Probes.state = 1;
                    Probes.wait = getRandomInt(250,1000);
                }
                break;
            case 1: // decision
                if(Probes.go_return=="go"){
                    var dest = randomMineral(Probes.lastMin);
                    Probes.go_return="return";
                }else{
                    var dest = mid;
                    Probes.go_return="go";
                }
                Probes.lastMin = dest;

                // the direction to get there...
                Probes.dx = (dest.position[0] - Probes.position[0]);
                Probes.dz = (dest.position[2] - Probes.position[2]);
                Probes.dst0 = Math.sqrt(Probes.dx*Probes.dx + Probes.dz*Probes.dz);
                Probes.dst = Math.sqrt(Probes.dx*Probes.dx + Probes.dz*Probes.dz) - (Probes.go_return=="go"? 2.4:0.9);
                if (Probes.dst < .01) {
                    // small distance - just go there
                    Probes.position[0] = dest.position[0];
                    Probes.position[2] = dest.position[2];
                    Probes.state = 3;
                } else {
                    Probes.vx = Probes.dx / Probes.dst0;
                    Probes.vz = Probes.dz / Probes.dst0;
                }
                Probes.dir = Math.atan2(Probes.dx,Probes.dz) - Probes.dir_o;
                Probes.state = 2;
                break;
            case 2: // spin towards goal
                var dtheta = Probes.dir - Probes.orientation;
                // if we're close, pretend we're there
                if (Math.abs(dtheta) < .01) {
                    Probes.state = 3;
                    Probes.orientation = Probes.dir;
                }
                var rotAmt = turningSpeed * delta;
                if (dtheta > 0) {
                    Probes.orientation = Math.min(Probes.dir,Probes.orientation+rotAmt);
                } else {
                    Probes.orientation = Math.max(Probes.dir,Probes.orientation-rotAmt);
                }
                break;
            case 3: // fly towards goal
                if (Probes.dst > .01) {
                    var go = delta * flyingSpeed;
                    // don't go farther than goal
                    go = Math.min(Probes.dst,go);
                    Probes.position[0] += Probes.vx * go;
                    Probes.position[2] += Probes.vz * go;
                    Probes.dst -= go;
                } else { // we're effectively there, so go there
                    Probes.state = 0;
                }
                break;
        }
    }
